import React from 'react'
import {Link} from 'react-router-dom';

export const NavBar = () => {
  return (


    <nav className="navbar navbar-expand-lg navbar-dark bg-dark">


    <Link to="/" className="navbar-brand" href="#">useContext</Link>
    <div className="collapse navbar-collapse" id="navbarNavAltMarkup">
      <div className="navbar-nav">
        <Link exact activeClassName="active" className="nav-link" to="./" >Home <span className="sr-only">(current)</span></Link>
        <Link exact activeClassName="active" className="nav-link" to="./about">about</Link>
        <Link exact activeClassName="active" className="nav-link" to="./login">login</Link>
      
      </div>
    </div>
    </nav>
  )
}
